import "./Expenses.css";

import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div>
      <ExpenseItem
        title={props[0].items[0].title}
        amount={props[0].items[0].amount}
        date={props[0].items[0].date}
      />
      <ExpenseItem
        title={props[1].items[1].title}
        amount={props.items[1].amount}
        date={props[1].items[1].day}
      />
      <ExpenseItem
        title={props[1].items[2].title}
        amount={props[1].items[2].amount}
        date={props[1].items[2].day}
      />
      <ExpenseItem
        title={props.items[3].title}
        amount={props.items[3].amount}
        date={props.items[3].day}
      />
    </div>
  );
}

export default Expenses;
